import React from 'react';
import Menu from './Menu/menu.js';
import './header.css'

class Header extends React.Component{
  render() {
    return (
      <div className="header container-fluid">
        <Menu data = {this.props.data.Menu}/>
      </div>
    );
  }
}
export default Header
